const WeatherData = ({ city, weather}) => {
    if (!weather) {
        return(
            <div></div>
        )
    }
    return (
        <>
            <h3>Weather in {city}</h3>    
            <div><strong>temperature: {weather.temperature}</strong></div>    
        </>
    )
}

export default WeatherData
